import React, { Component } from 'react';
import { Container, Alert } from 'react-bootstrap';
import {Link} from 'react-router-dom'
class User extends Component {
    render() {
        console.log(this.props)
        return (
            <Container>
                <Alert className='h3' variant="primary">Thông tin tài khoản <Link to={this.props.match.url}>{this.props.match.params.user_id}</Link></Alert>
            </Container>
        );
    }
}

export default User;
